import React, { useState } from 'react';
import styled from 'styled-components';
import Child from './Child';

function Parent() {
    // const [value, setValue] = useState([])
    const [data, setData] = [
        {
            id: 0,
            text: '안녕하세요1'
        },
        {
            id: 1,
            text: '안녕하세요2'
        },
        {
            id: 2,
            text: '안녕하세요3'
        }
    ];

    return (
        <>
            {data.map((item,idx) => {
                return (
                    <Child key={ idx}text={item.text}/>
                );
            })}  
            <Input>
                <form>
                    <input type='text' />
                </form>
                <button>버튼</button>
            </Input>
        </>
    )
} 

export default Parent;

const Wrapper = styled.div``;

const Input = styled.div`
    display: flex;
`;
